import React from 'react';
import './Card.css';
import Chipotle from '../../images/chipotle.jpg'
import Star from '../../images/star.png'

const Card = () => {
  return (
    <div className="card">
      <div className="card-placeholder">Placeholder Text</div>
      <div className="card-image">
        <img src={Chipotle} alt="place image" />
      </div>
      <div className="card-content">
        <h2 className="restaurant-name">Restaurant Name</h2>
        <div className="rating">
          <span className="stars">&#9733;&#9733;&#9733;&#9733;&#9733;</span>
          <span className="rating-number">4.8</span>
        </div>
        <p className="review-placeholder">Review</p>
        <p className="review-placeholder">"Best meal I've had in a while!"</p>
      </div>
      <div className="card-button">
        <button>View All Restaurants</button>
      </div>
    </div>
  );
};

export default Card;
